The generated application has the following content: fn main() { if let Err(e) = try_main() { eprintln!("error: {:#}", e); }
} fn try_main() -> Result<(), anyhow::Error> { Ok(())
} Let's adapt it to load our program. We'll need the following imports at the top of the file: use aya::Bpf;
use aya::programs::{Xdp, XdpFlags};
use std::{ convert::TryInto, env, thread, time::Duration,
}; Then we'll adapt the try_main function to load our program: fn try_main() -> Result<(), anyhow::Error> { let path = match env::args().nth(1) { Some(iface) => iface, None => panic!("not path provided"), }; let iface = match env::args().nth(2) { Some(iface) => iface, None => "eth0".to_string(), }; let mut bpf = Bpf::load_file(&path)?; let probe: &mut Xdp = bpf.program_mut("xdp")?.try_into()?; probe.load()?; probe.attach(&iface, XdpFlags::default())?; for _i in 1..10 { thread::sleep(Duration::from_secs(1)); }; Ok(())
} The program takes two positional arguments The path to our eBPF application The interface we wish to attach it to (defaults to eth0) The line let mut bpf = Bpf::load_file(&path)?;: Opens the file Reads the ELF contents Creates any maps If your system supports BPF Type Format (BTF), it will read the current BTF description and performs any necessary relocations Once our file is loaded, we can extract the XDP probe with let probe: &mut Xdp = bpf.program_mut("xdp")?.try_into()?; and then load it in to the kernel with probe.load(). Finally, we can attach it to an interface with probe.attach(&iface, XdpFlags::default())?; Let's try it out! cargo build
